import { Points3D } from '../utils/point3D'
import { JSONHandler } from '../utils/JSONHandler'

import { ActionUnits, AvatarPrediction, Rotation, Transform } from '../types'

const CENTER_POINT = 5

export type AvatarDenseMeta = {
  readonly point_indexes: number[]
  readonly type: string
  readonly label_keys: string[][]
  readonly tris: number[]
  readonly data_min: number[]
  readonly data_max: number[]
  readonly data_means: number[]
  readonly data_vars: number[]
  readonly data_std: number[]
}

export type TuneParam = {
  fps: number
  minCutoff: number
  beta: number
  bezier_x1: number
  bezier_y1: number
  bezier_x2: number
  bezier_y2: number
}

export type PointEuro = {
  x: OneEuroFilter
  y: OneEuroFilter
  z: OneEuroFilter
}

export type TuneParams = { [key: string]: TuneParam }

const leftEyePoint = 33
const rightEyePoint = 263
const bottomChinPoint = 152

export default class AvatarDenseCombinePredictor {
  private modelMeta!: AvatarDenseMeta
  private tune!: TuneParams
  private actionUnitModel!: tf.LayersModel
  private filters!: { [key: string]: OneEuroFilter }
  private easingCurves!: { [key: string]: EasingFunction }

  private pitchFilter = new OneEuroFilter(20, 0.001, 1, 1.0)
  private yawFilter = new OneEuroFilter(20, 0.001, 5, 1.0)
  private rollFilter = new OneEuroFilter(20, 0.001, 5, 1.0)

  private transformX = new OneEuroFilter(20, 0.001, 1, 1.0)
  private transformY = new OneEuroFilter(20, 0.001, 5, 1.0)
  private transformZ = new OneEuroFilter(20, 0.001, 5, 1.0)

  async predictFace(results: Results): Promise<AvatarPrediction> {
    if (results.multiFaceLandmarks.length < 1) {
      return
    }

    engine().startScope()

    const pointsData = results.multiFaceLandmarks[0].map(point => [
      point.x * results.image.width,
      point.y * results.image.height,
      point.z * results.image.width
    ]) as Points3D

    const rotationRaw = findRotation(pointsData, leftEyePoint, rightEyePoint, bottomChinPoint)
    const rotation = this._rotationTune(rotationRaw)
    const transformRaw = findTransform(results.multiFaceLandmarks[0], CENTER_POINT)
    const transform = this._transformTune(transformRaw)
    const prediction = await this.createPrediction(this.actionUnitModel, this.modelMeta, pointsData)
    const actionUnits: ActionUnits = {}
    const mouthLabelKeys = this.modelMeta.label_keys

    mouthLabelKeys.forEach((group, groupIndex) => {
      group.forEach((key, keyIndex) => {
        const predictionValueForKey = prediction[groupIndex][keyIndex]
        const minmax = Math.min(Math.max(predictionValueForKey - 0.0, 0), 1.0)
        const filter = this.filters[key]
        const bezier = this.easingCurves[key]
        const smoothMinMax = filter.filter(minmax)
        let returnValue = smoothMinMax
        returnValue = bezier(returnValue)

        // The current output keys don't match ARKit Standard
        // TODO: Update model to spit out correct keys
        actionUnits[hallwayToARKit[key]] = returnValue * 1.15
      })
    })

    const mouthSmileLeft = actionUnits.mouthSmileLeft
    const mouthSmileRight = actionUnits.mouthSmileRight
    const eyeBlinkLeft = actionUnits.eyeBlinkLeft
    const eyeBlinkRight = actionUnits.eyeBlinkRight

    const browDownResult = this._diffAmp(0.5, 'browDownLeft', 'browDownRight', actionUnits)
    actionUnits.browDownLeft = browDownResult.leftAmp * (1 - eyeBlinkLeft / 2)
    actionUnits.browDownRight = browDownResult.rightAmp * (1 - eyeBlinkRight / 2)

    const browUpResult = this._diffAmp(0.5, 'browOuterUpLeft', 'browOuterUpRight', actionUnits)
    actionUnits.browOuterUpLeft = browUpResult.leftAmp
    actionUnits.browOuterUpRight = browUpResult.rightAmp

    const smileResult = this._diffAmp(0.5, 'mouthSmileLeft', 'mouthSmileRight', actionUnits)
    actionUnits.mouthSmileLeft = smileResult.leftAmp
    actionUnits.mouthSmileRight = smileResult.rightAmp

    actionUnits.mouthUpperUpLeft = actionUnits.mouthUpperUpLeft * (1 - actionUnits.mouthSmileRight * 0.2)
    actionUnits.mouthUpperUpRight = actionUnits.mouthUpperUpRight * (1 - actionUnits.mouthSmileLeft * 0.2)

    const upperup = this._diffAmp(0.2, 'mouthUpperUpLeft', 'mouthUpperUpRight', actionUnits)
    actionUnits.mouthUpperUpLeft = upperup.leftAmp
    actionUnits.mouthUpperUpRight = upperup.rightAmp

    actionUnits.eyeBlinkLeft = eyeBlinkLeft * (1 - mouthSmileRight * 0.5)
    actionUnits.eyeBlinkRight = eyeBlinkRight * (1 - mouthSmileLeft * 0.5)

    actionUnits.mouthShrugUpper = actionUnits.mouthShrugUpper / 2

    const predictions = {
      actionUnits,
      rotation,
      transform
    }

    engine().endScope()

    return predictions
  }

  private _diffAmp(damping: number, keyLeft: string, keyRight: string, actionUnits: { [key: string]: number }) {
    const valueLeft = actionUnits[keyLeft]
    const valueRight = actionUnits[keyRight]
    const leftDiff = (valueLeft - valueRight) * damping
    const rightDiff = (valueRight - valueLeft) * damping

    // need to tune it so that the one that is moving in the positive dir gets amped and the one thats not gets damped
    const leftAmp = Math.min(Math.max(leftDiff + valueLeft - 0.0, 0), 1.0)
    const rightAmp = Math.min(Math.max(rightDiff + valueRight - 0.0, 0), 1.0)

    return {
      leftAmp: leftAmp,
      rightAmp: rightAmp
    }
  }

  async init() {
    const model = JSON.parse(MODEL)
    const modelPath =
      'https://hallway-public.nyc3.digitaloceanspaces.com/webSDK/Mouth_Smile_Opene_uint16_bin_norm_dist7/'

    this.actionUnitModel = await tf.loadLayersModel(new JSONHandler(model, modelPath))
    this.modelMeta = JSON.parse(ALL_AU_META)

    this._initializeTune()
  }

  private _initializeTune() {
    this.tune = JSON.parse(TUNE_PARAMS)
    this.filters = {}
    this.easingCurves = {}

    const labelKeys = this.modelMeta.label_keys

    const defaultValue: TuneParam = {
      fps: 120,
      minCutoff: 0.01,
      beta: 25,
      bezier_x1: 0.08894012120656589,
      bezier_y1: 0.003999877929687479,
      bezier_x2: 0.8217921067661327,
      bezier_y2: 0.8839998779296875
    }

    for (const row of labelKeys) {
      for (const keyName of row) {
        if (keyName in this.tune) {
          const values = this.tune[keyName]

          this.filters[keyName] = new OneEuroFilter(30, 0.001, 10, 1)

          this.easingCurves[keyName] = BezierEasing(
            values.bezier_x1,
            values.bezier_y1,
            values.bezier_x2,
            values.bezier_y2
          )
        } else {
          this.filters[keyName] = new OneEuroFilter(defaultValue.fps, defaultValue.minCutoff, defaultValue.beta, 1)
          this.easingCurves[keyName] = BezierEasing(
            defaultValue.bezier_x1,
            defaultValue.bezier_y1,
            defaultValue.bezier_x2,
            defaultValue.bezier_y2
          )

          this.tune[keyName] = defaultValue
        }
      }
    }

    this.filters['tune_points'] = new OneEuroFilter(60, 0.001, 5, 1)
    this.easingCurves['tune_points'] = BezierEasing(
      defaultValue.bezier_x1,
      defaultValue.bezier_y1,
      defaultValue.bezier_x2,
      defaultValue.bezier_y2
    )

    this.tune['tune_points'] = {
      fps: 60,
      minCutoff: 0.001,
      beta: 5,
      bezier_x1: 0.08894012120656589,
      bezier_y1: 0.003999877929687479,
      bezier_x2: 0.8217921067661327,
      bezier_y2: 0.8839998779296875
    }
  }

  private _rotationTune = (rotation: Rotation): Rotation => {
    const pitch = this.pitchFilter.filter(rotation.pitch)
    const yaw = this.yawFilter.filter(rotation.yaw)
    const roll = this.rollFilter.filter(rotation.roll)

    return { pitch, yaw, roll }
  }

  private _transformTune = (transform: Transform): Transform => {
    const x = this.transformX.filter(transform.x)
    const y = this.transformY.filter(transform.y)
    const z = this.transformZ.filter(transform.z)

    return { x, y, z }
  }

  private _getScalerTriFeatureVectorDot(
    points: Points3D,
    tris: number[],
    dataMeans: number[],
    dataStd: number[]
  ): Tensor<Rank> {
    let features: any = []

    let offset = 0
    for (let i = 0; i < tris.length; i++) {
      const featureData = tris[i]
      const selectedVerticies = featureData[0]
      const selectedTris = featureData[1]

      const selectedPoints: Points3D = []
      for (let j = 0; j < selectedVerticies.length; j++) {
        const pointIndex = selectedVerticies[j]
        selectedPoints.push(points[pointIndex])
      }

      const normalizedPoints = normalizePoints(selectedPoints)
      const newFeatures = getTriDotFeatures(normalizedPoints, selectedTris, dataMeans, dataStd, offset)
      features = features.concat(newFeatures)
      offset += (selectedTris.length / 3) * 2
    }

    return tf.tensor([features])
  }

  // Float32Array | Int32Array | Uint8Array
  async createPrediction(model: tf.LayersModel, modelMeta: AvatarDenseMeta, points: Points3D): Promise<any> {
    const type = modelMeta.type

    let tensorInput: tf.Tensor<tf.Rank>
    if (type == 'multi_spur_dot') {
      tensorInput = this._getScalerTriFeatureVectorDot(points, modelMeta.tris, modelMeta.data_means, modelMeta.data_std)
    } else {
      tensorInput = tf.zeros([0, 0])
    }

    const tensorOutput = model.predict(tensorInput) as tf.Tensor<tf.Rank> | tf.Tensor<tf.Rank>[]
    const out = []

    if (tensorOutput instanceof tf.Tensor) {
      out.push(tensorOutput.dataSync())
    } else if (tensorOutput instanceof Array) {
      for (let i = 0; i < tensorOutput.length; i++) {
        out.push(tensorOutput[i].dataSync())
      }
    }

    return out
  }
}

